window.bookSummaryJSON = "<p>Everyone thinks I'm a genius. Everyone is wrong. Sure, I finished Harvard at 18 and now make crazy money at a hedge fund. But that's not because I'm unusually smart or hard-working. It's because I cheat. </p> <p>You see, I have a unique ability. I can go outside time into my own personal version of reality - the place I call - \"the Quiet\" - where I can explore my surroundings while the rest of the world stands still. </p> <p>I thought I was the only one who could do this - until I met her. My name is Darren, and this is how I learned that I'm a Mind Reader.</p>"; 
